import React,{ Component } from "react";
import { Navbar, NavbarBrand } from 'reactstrap';

class App extends Component{


  render(){
    return( 
      <div className="App">
        <Navbar >
          <div className="container">
            <NavbarBrand href="/" style={{textdecoration : none}}>restorant amit</NavbarBrand>
          </div>
        </Navbar>
      </div>
    );
  }
}
export default App;
